import './App.css'
import Header from './Header';
import Post from './Post';
import { Route, Routes } from 'react-router-dom'
function App() {
  return (
    <Routes>
      <Route index element={
        <main>
          <Header />
          <Post />
          <Post />
          <Post />
        </main>
      } />
      <Route path={'/login'} element={
        <div>Login</div>
      } />
    </Routes>

  );
}

export default App;
